import { Injectable } from '@angular/core';
import {HttpClient} from "@angular/common/http";

interface loadData{
  clients: [],
  tasks: [],
  timesheet:[],
  message: string
}

@Injectable({
  providedIn: 'root'
})
export class DataloadService {

  private apiURL:string = 'http://localhost:5000/endpoint/load';
  constructor(private loadDataClient: HttpClient) { }
  loadData(){
    return this.loadDataClient.get<loadData>(this.apiURL);
  }

}
